def clip_shp(in_shp, clip_shp, savepath):
    arcpy.Clip_analysis(in_shp, clip_shp, savepath)


def clip_raster_cliiper(in_raster, clipper, savepath, nodata_value):
    arcpy.Clip_management(in_raster, in_template_dataset=clipper,
                          out_raster=savepath, nodata_value=nodata_value, maintain_clipping_extent="MAINTAIN_EXTENT")


def clip_raster_rectangle(in_raster, rectangle, savepath, nodata_value):
    Lon_min, Lat_min, Lon_max, Lat_max = rectangle
    arcpy.Clip_management(in_raster, rectangle='{} {} {} {}'.format(Lon_min, Lat_min, Lon_max, Lat_max),
                          out_raster=savepath, nodata_value=nodata_value, maintain_clipping_extent="MAINTAIN_EXTENT")


def shp_to_raster(in_features, field, out_raster, cell_size):
    arcpy.FeatureToRaster_conversion(in_features, field, out_raster, cell_size=cell_size)


def create_shp(rectangle, save_path):
    Lon_min, Lat_min, Lon_max, Lat_max = rectangle
    points = [[Lon_min, Lat_min], [Lon_min, Lat_max], [Lon_max, Lat_max], [Lon_max, Lat_min], [Lon_min, Lat_min]]
    SR = arcpy.SpatialReference(4326)  # WGS84
    # 组成环的Array对象
    ring = arcpy.Polygon(arcpy.Array([arcpy.Point(*p) for p in points]), SR)
    # 创建features列表，用于存放要素，在内存
    features = []
    # 通过ring（Array）创建Polygon对象
    # 将Polygon要素添加到features列表
    features.append(ring)
    # 调用复制要素工具，将内存中的features列表创建为shapefile
    arcpy.CopyFeatures_management(features, save_path)


